import React, { useEffect, useState } from 'react';
import InstagramFeed  from 'react-ig-feed';
import 'react-ig-feed/dist/index.css';
import { getInstaToken } from "./apiCore";

const Instagram = () => {

    const [instaTokenResult, setInstaTokenResult] = useState([]);

    const loadInstaSetting = () => {
      getInstaToken().then((data) => {

          console.log(data);
          setInstaTokenResult(data);

      });
    };

    useEffect(() => {
      loadInstaSetting();
    }, []);

    console.log(instaTokenResult);

    return instaTokenResult.map(({ token }) => (
      <div>
        <div className='instagram-section pt-5'>
          <div className='container-fluid'>
            <div className='row justify-content-center'>
              <div className='col-lg-7 col-md-10'>
                <div className='section_title text-center'>
                  <h3>Pet Stories</h3>
                  <h4>Follow us on Instagram @safaristansnh and @safaristanss</h4>
                </div>
              </div>
            </div>

            {instaTokenResult.map((item, index) =>

              item.children.length === 0 ? (
                <Nav.Link
                  href={item.href}
                  key={item.text}
                  {...(item.target !== undefined && { target: item.target })}
                >
                  {item.text}
                </Nav.Link>
              ) : (
                <PermissionsMenu items={item} key={`${item.text}-${index}`} />
              )
            )}
            <InstagramFeed token={ item.token }  counter="6"/>

          </div>
        </div>
      </div>
    ));

};

export default Instagram;
